  handleDelete,
  handleEditContent,
}) {
  const handleEdit = () => {
    handleShow();
  };

  return (
    <>
      <div className="card">
        <div className="title">
          <h3>
            {id}.{name}
          </h3>
          <p>{content}</p>
          <button onClick={handleDelete}>Remove</button>
          <button onClick={handleEdit}>Edit</button>
        </div>
      </div>
    </>
  );
}
